class ClockConstructor extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            data: {
                url: {
                    vinyls: ["https://lh3.googleusercontent.com/oTB_9IbUmbEBtIv_8LdJfGJthzx-8S4UmdxakENzPyYXMizOaDBke7ZnT7ONNqoVr1hSPyTLthB9vQ=w1855-h966-rw",
                        "https://lh5.googleusercontent.com/BilGV9eQOu_iNalyYO-feYcBE4FQrVv4mbV4v5XQ_GqOswS1j2-4gfkBiKjrUNrO9qn-7jR7w9RkLA=w1855-h966-rw",
                        "https://lh4.googleusercontent.com/QSxsk5H45Pq3pzDk4YbvXcJFNbZG9n057epHR8ftbbTuCnD_HyOQABBGKa7OPQ5-VwYA8bdPhWliwg=w1855-h966-rw"
                    ],

                    dials: [],
                    hands: [],

                    template: "https://lh6.googleusercontent.com/sZUv20YDxEiDqMtAACQjo9TVnY1Lh-zTroxdefNiq4DHiPL4dmOtxAV_h0UeybIThzfPbJ1DWxdx0w=w1855-h966-rw",

                },
                clockView: ""
            }
        };
        this.onClickSelectVinyl = this.onClickSelectVinyl.bind(this);
    }

    onClickSelectVinyl(element) {

        console.log(this.state.data.clockView);
        this.setState({
            data: {
                clockView: element.target.src
            }
        });



    }

    render() {

        return (
            <div className="container constructor">
                <div className="row">
                    <ConstructorContainerBlock clockView={(this.state.data.clockView) ? this.state.data.clockView :
                        this.state.data.url.template}/>

                    <ConstructorPanelBlock onClickSelectVinyl={this.onClickSelectVinyl}/>

                </div>
            </div>
        );
    }
}

ReactDOM.render(
    <ClockConstructor/>
    , document.querySelector('#root-clock-constructor')
);